    HomeImage, 
    HomeTitle,
} from "./styles";


const Home = () => {

    return(
        <HomeContainer>
            <Navigation/>
            <HomeTitle>
                <h2>Hi, I'm <span className="home-name">Angelique <span role="img" aria-label="girl in a computer">üë©üèª‚Äçüíª</span></span></h2>
                <h3>
                    <Typical
                        loop={Infinity}
                        wrapper="b"
